import React, {Fragment} from 'react';
import { Query } from 'react-apollo';
import { songs_query } from '../../querys/querys';
import './canciones.css'

class Canciones extends React.Component {
    render () {
        return(
            <Fragment>
                <h1 className='title-content'>Canciones</h1>
                <div className='songs-container'>
                    <Query query={songs_query}>
                        {({loading, error, data}) => {
                            if (loading) return 'loading...';
                            if (error) return `Error: ${error.message}`;
                            console.log(data.getSongs);
                            return (
                                <div className='name-song-container'>
                                    <div><span>{data.getSongs}</span></div>
                                    <div><span>{data.getSongs[0].artista}</span></div>
                                    <div><span>{data.getSongs[0].album}</span></div>
                                </div>
                            
                            );

                        }}
                    </Query>
                </div>
            </Fragment>
        );
    }
}

export default Canciones;
